import "./Styles/Split.css";
import Row from "react-bootstrap/Row";
import Image from "./Images/imge.jpeg";
import NavBar from "./Components/NavBar";
import SurveyForm from "./Components/SurveyForm";
const App: React.FC = () => {
  return (
    <>
      <NavBar />
      <section className="intro">
        <Row>
          <div className="col-lg-6 col-sm-12 left" id="first">
            <img height="100%" alt="" src={Image} />
          </div>
          <div className="col-lg-6 col-sm-12 right" id="second">
            <SurveyForm />
          </div>
        </Row>
      </section>
    </>
  );
};

export default App;
